import React, { Fragment } from 'react';
import './Nav2.css';



class Nav2 extends React.Component{
    constructor(props){
        super(props);
        

    }


    render(){
        return(
            <div className="main-nav">
				<nav>
                <ul>
                    <li>
                    <a href="#">Home</a>
                    <ul class="sub_menu">
							<li><a href="#">Lorem</a></li>
							<li><a href="#">Ipsum</a></li>
							<li><a href="#">Dolor</a></li>
							<li><a href="#">Lipsum</a></li>
							<li><a href="#">Consectetur </a></li>
							<li><a href="#">Duis</a></li>
							
        		    </ul>
                    </li>
                    <li>
                    <a href="#">About</a>
                    </li>
                    <li>
                    <a href="#">Services</a>
                    </li>
                    <li>
                    <a href="#">Contact</a>
                    </li>
                </ul>
                </nav>
			</div>
        );
    }
}   



export default Nav2;
